const newsStyle = {
    container:{
        height: '110vh',
    },
    section1:{
        position: 'absolute',
        zIndex: '10',
        width: '30vw',
        height: '110vh',
        backgroundColor: '#2CE7E8',
        transition: '500ms',
        '&:hover': {
            transform: 'scaleX(1)',
            transform: 'translateX(1)',
            zIndex: '30'
        }
    },
    section2:{
        position: 'absolute',
        zIndex: '20',
        marginLeft: '30vw',
        width: '66vw',
        height: '110vh',
        backgroundColor: '#26FFD7'
    }
};

export default newsStyle;
